import React, { Component } from 'react';
import Add from './add';
import Password from './password';

import './body.css';
import './add.css';

class Pass extends Component {
    state = {
        init: true,
        passCorrect: false
    }

    callBack = (passBool) => {
        this.setState({passCorrect: passBool})
        console.log(passBool);
    }

    render() {
        if (this.state.init || !this.state.passCorrect) {
            this.state.init = false;
            return (
                <div>
                <div className="main">
                    <h1 className="title">ADD</h1>
                </div>


                <Password parCallBack={this.callBack}/>
                </div>
            );
        }
        else {
            return (
                <div>
                <div className="main">
                    <h1 className="title">ADD</h1>
                </div>

                <Add/>
                </div>
            );
        }
    }

}

export default Pass;
